import './App.css';
import Menu from './Menu';
import List from './List';
import { render } from '@testing-library/react';


class App extends React.Component {
  constructor(props){
    super(props);

    this.state = {
      books:[
        {id:0, rating: 4, title: 'The Ballad of Buster Scrugs', image: './img/libro01.jpg'},
        {id:1, rating: 3, title: 'The Sister Brothers', image: './img/libro02.jpg'},
        {id:2, rating: 5, title: 'The Homesman', image: './img/libro03.jpg'},
        {id:3, rating: 5, title: 'Django', image: './img/libro04.jpg'},
        {id:4, rating: 5, title: 'Hostiles', image: './img/libro05.jpg'}
      ]
    };
  }
  render(){  
    return (
    <div className="App">
      <Menu title="Vladi.codes" />
      <List />
    </div>
  );
  }
}

export default App;
